import styles from "./SeeMore.module.scss";
import { useState } from "react";
import { FontAwesomeIcon, faQuestionCircle, faA } from '@fortawesome/react-fontawesome';
import { faEllipsisVertical } from '@fortawesome/free-solid-svg-icons'
import Menu from "../Menu";

function SeeMore() {
    const [listSeeMore] = useState([
        {
            text: "English",
            iconSeeMore: <FontAwesomeIcon className={styles["icon"]} icon={faA} />,
            children: [{ language: "English" }],
        },
        { text: "Feedback and help", iconSeeMore: faQuestionCircle },
        { text: "Keyboard shortcuts", iconSeeMore: faQuestionCircle },
    ]);

    return (
        <div className={styles['see-more-icon']}>
            <FontAwesomeIcon icon={faEllipsisVertical} />
            <Menu list={listSeeMore}/>
        </div>
    );

}

export default SeeMore;
